output: [0, 0, 3, 3, 3, 3, 0, 0, 0, 0]

Example_3:
input: [7, 0, 0, 0, 7, 0, 0, 0, 0, 0]
output: [7, 7, 7, 7, 7, 0, 0, 0, 0, 0]

Test case:
input: [0, 4, 0, 4, 0, 0, 0, 0, 0, 0]

